import React from 'react'
import { propTypes } from 'react-bootstrap/esm/Image';
function Music(props) {
    console.log(__dirname);
    return (
        <>
            <audio controls>
                <source src={propTypes.src} type={props.type}/>
            </audio>
        </>
    )
}
export default Music;
